import React from "react";
import "./SkillsInfoCard.css";
const SkillsInfoCard = ({ heading, skills }) => {
  return (
    <div className="skills-info-card">
      <h6>{heading}</h6>
      <div className="skills-info-content"></div>
    </div>
  );
};

export default SkillsInfoCard;
